INSERT INTO `book_of_the_day` (`id`, `title`, `title_link`, `author`, `author_link`, `cover_link`, `description`, `comments`) VALUES
(1, 'George', 'https://www.goodreads.com/book/show/28143290-george', 'Alex Gino', 'https://www.goodreads.com/author/show/12881739.Alex_Gino', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1423358952l/24612624._SX98_.jpg', 'BE WHO YOU ARE. When people look at George, they think they see a boy. But she knows she\'s not a boy. She knows she\'s a girl.\r\n\r\nGeorge thinks she\'ll have to keep this a secret forever. Then her teacher announces that their class play is going to be Charlotte\'s Web. George really, really, REALLY wants to play Charlotte. But the teacher says she can\'t even try out for the part... because she\'s a boy.\r\n\r\nWith the help of her best friend, Kelly, George comes up with a plan. Not just so she can be Charlotte—but so everyone can know who she is, once and for all.', NULL),
(2, 'The Night Circus', 'https://www.goodreads.com/book/show/9361589-the-night-circus', 'Erin Morgenstern', 'https://www.goodreads.com/author/show/4370565.Erin_Morgenstern', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1479361717l/12606483._SX98_.jpg', 'The circus arrives without warning. No announcements precede it. It is simply there, when yesterday it was not. Within the black-and-white striped canvas tents is an utterly unique experience full of breathtaking amazements. It is called Le Cirque des Rêves, and it is only open at night.\r\n\r\nBut behind the scenes, a fierce competition is underway—a duel between two young magicians, Celia and Marco, who have been trained since childhood expressly for this purpose by their mercurial instructors. Unbeknownst to them, this is a game in which only one can be left standing, and the circus is but the stage for a remarkable battle of imagination and will. Despite themselves, however, Celia and Marco tumble headfirst into love—a deep, magical love that makes the lights flicker and the room grow warm whenever they so much as brush hands.\r\n\r\nTrue love or not, the game must play out, and the fates of everyone involved, from the cast of extraordinary circus performers to the patrons, hang in the balance, suspended as precariously as the daring acrobats overhead.\r\n\r\nWritten in rich, seductive prose, this spell-casting novel is a feast for the senses and the heart.', NULL),
(3, 'The Martian', 'https://www.goodreads.com/book/show/18007564-the-martian', 'Andy Weir', 'https://www.goodreads.com/author/show/6540057.Andy_Weir', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1413706054l/18007564._SX98_.jpg', 'Six days ago, astronaut Mark Watney became one of the first people to walk on Mars.\r\n\r\nNow, he’s sure he’ll be the first person to die there.\r\n\r\nAfter a dust storm nearly kills him and forces his crew to evacuate while thinking him dead, Mark finds himself stranded and completely alone with no way to even signal Earth that he’s alive—and even if he could get word out, his supplies would be gone long before a rescue could arrive.\r\n\r\nChances are, though, he won’t have time to starve to death. The damaged machinery, unforgiving environment, or plain-old “human error” are much more likely to kill him first.\r\n\r\nBut Mark isn’t ready to give up yet. Drawing on his ingenuity, his engineering skills — and a relentless, dogged refusal to quit — he steadfastly confronts one seemingly insurmountable obstacle after the next. Will his resourcefulness be enough to overcome the impossible odds against him?', NULL),
(4, 'Moonfall', 'https://www.goodreads.com/book/show/337134.Moonfall', 'Jack McDevitt', 'https://www.goodreads.com/author/show/73812.Jack_McDevitt', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1399945935l/337134._SX98_.jpg', 'It\'s the 21st century, and all is right with the world. Or so it seems.\r\n\r\nVice President Charlie Haskell, who will travel anywhere for a photo op, is about to cut the ribbon for the just-completed American Moonbase. The first Mars voyage is about to leave high orbit, with a woman at the helm. Below, the world is marveling at a rare solar eclipse.\r\n\r\nBut all that is right is about to go disastrously wrong when an amateur astronomer discovers a new comet. Named for its discover, Tomikois a \"sun-grazer,\"an interstellar wanderer with a hundred times the mass and ten times the speed of other comets. And it is headed straight for our moon.\r\n\r\nIn less than five days, if scientists\' predictions are right, Tomiko will crash into the moon, shattering it into a cloud of superheated gas, dust, and huge chunks of rock that will rain down on the earth, causing chaos and killer storms, possibly tidal waves inundating entire cities...or worse: a single apocalyptic worldwide \"extinction event.\"\r\n\r\nIn the meantime, the population of Moonbase must be evacuated by a hastily assembled fleet of shuttle rockets. There isn\'t room, or time enough, for everyone. And the vice president, who rashly promised to be last off (\"I will lock the door and turn off the lights\"), is trying to figure out how to get away without eating his words.\r\n\r\nIn Moonfall,McDevitt has created a disaster thriller of truly epic proportions, featuring a cast of unforgettable characters: the reluctant Russian rocket jockey entrusted with the lives of squabbling refugees; the woman chosen to be first on the moon; the scientist who must deflect the \"possum\" (POSSible IMpactors) knocked from orbit or witness the end science itself. And at the center of it all is Charlie Haskell, the career politician who discovers his own unexpected reserves of only himself and his country, but for all humankind.\r\n\r\nMoonfall,is a spellbinding tale of heroism and hope, cowardice and passion played against the awesome spectacle of human history\'s darkest night.', NULL),
(5, 'Sherlock Holmes: The Definitive Audio Collection', 'https://www.goodreads.com/book/show/34429916-sherlock-holmes', 'Arthur Conan Doyle', 'https://www.goodreads.com/author/show/2448.Arthur_Conan_Doyle', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1488293263l/34429916._SX98_.jpg', 'Ever since he made his first appearance in A Study In Scarlet, Sherlock Holmes has enthralled and delighted millions of fans throughout the world. Now Audible is proud to present Arthur Conan Doyle\'s Sherlock Holmes: The Definitive Collection, read by Stephen Fry. A lifelong fan of Doyle\'s detective fiction, Fry has narrated the complete works of Sherlock Holmes - four novels and five collections of short stories. And, exclusively for Audible, Stephen has written and narrated nine insightful, intimate and deeply personal introductions to each title.\r\n\r\nHe writes: \"Popular fiction offers different kinds of superheroes to save the world by restoring order to the chaos, confusion and criminality of our times. Heroes with remarkable gifts are as in vogue now as they have been since they first appeared, perhaps even more in vogue. But although the very first one was launched in serial published form just like his masked and body-suited successors, it was not in DC or Marvel comic books that he made his appearance; rather it was in the sedate and respectable pages of Mrs Beeton\'s Christmas Annual in the mid-Victorian year 1887.\"\r\n\r\nStephen Fry is an English actor, screenwriter, author, playwright, journalist, comedian, television presenter, film director and all round national treasure. He is the acclaimed narrator of J.K. Rowling\'s Harry Potter audiobooks and most recently recorded The Tales of Max Carrados for Audible Studios. Stephen has contributed columns and articles to newspapers and magazines, appears frequently on radio and has written four novels and three volumes of autobiography.', NULL),
(6, 'Illuminae', 'https://www.goodreads.com/book/show/25524728-illuminae', 'Amie Kaufman & Jay Kristoff', 'https://www.goodreads.com/author/show/5360335.Amie_Kaufman', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1431407155l/25524728._SX98_.jpg', 'One moment, Kady Grant and Ezra Mason have nothing bigger to worry about than each other. Specifically, avoiding each other in the wake of their messy break-up. In the next second, their entire world falls apart.\r\n\r\nThe year is 2375 and one of the mega-corporations that control much of deep space has just fired the opening salvo in an intergalactic war, destroying Kady and Ezra\'s planet. Forced to flee on a small fleet of crippled rescue ships alongside thousands of other refugees, the fear of enemy warships chasing them down is at first all-consuming but soon becomes the least of their worries. A deadly plague is ravaging the refugees on the ships; the fleet\'s AI, which should be protecting them, may actually be an enemy; and High Command is refusing to acknowledge that there may be a serious problem. As Kady plunges into a tangled web of data in search of the truth, she realises that Ezra is possibly the only person who can help her save the refugees before it\'s too late.', NULL),
(7, 'Fuck Yeah, Video Games: The Life and Extra Lives of a Professional Nerd', 'https://www.goodreads.com/book/show/51552046-fuck-yeah-video-games', 'Daniel Hardcastle', 'https://www.goodreads.com/author/show/18090676.Daniel_Hardcastle', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1570432458l/51552046._SX98_SY160_.jpg', 'As I rapidly career towards 30 like the Hovis advert kid after someone had cut his brakes, I’ve decided to look back on what really made me happy in life. The friends, the romances, the experiences. All of these pale in comparison to video games.\r\n\r\nWhen I was growing up all we had for entertainment was a dirty rock, a finished book of crosswords and an 11 second long VHS called The Best of Eastenders. The only social network was the back of a public bathroom door and pornography had to be sourced from the foliage just outside of school. These were dark times.\r\n\r\nHowever, somethingsomething years ago we invented video games! Now instead of passing the time by spinning around in circles until you died, we could plug a box into the TV and shoot monsters in the face! The boxes got bigger, the monsters got shinier and now we’ve all got boxes in our house with more teraflops than people who actually know what a teraflop is!\r\n\r\nSadly, this wasn’t to last. As video games received more popularity, they attracted the worst kind of people imaginable. Businessmen. These bastards invented things like free-to-pay, loot boxes and microtransactions, tainting the once noble hobby of shooting fake monsters in the face. Video games looked to be doomed.\r\n\r\nIf only somebody, and I’m just taking a wild stab here, would write a book celebrating the brilliance of video games in a warm and whimsical manner. If only that book was filled with jokes, largely on topic anecdotes and more swear words than that YouTube video with the bootleg fireworks. Maybe that could save us all.\r\n\r\nHANG ON A SECOND. I’ve totally, accidentally just described the book I’ve been writing for the past year! What are the chances of that?!\r\n\r\nFuck Yeah, Video Games is a love letter to the greatest hobby of them all (that doesn’t primarily involve trains). Each chapter looks at a different game from the last 30 odd years and crams as many jokes, obscure references and personal stories into it as will fit. From God of War to Animal Crossing, SSX 3 to Noby Noby Boy it’s almost as if I’ve chosen the games to feature totally at random. (I pretty much did.)\r\n\r\nAlongside this march of merriment are a handful of chapters dedicated to the hardware behind the games. Here we celebrate the weird and wonderful world of consoles and peripherals. To be honest, it’s an excuse to write about really obscure Sega peripherals and so I could get Stuart Ashen of Attack of the Flickering Skeletons fame to write a chapter about Atari.\r\n\r\nAlso, sandwiching all of this together will be gorgeous, chunky illustrations by Rebecca featuring a cartoon me and many, many outfits. Rebecca’s nailed the look, even if I’ve been drawn much fatter than I hope I am.', NULL),
(8, 'Locke & Key, Vol. 1: Welcome to Lovecraft', 'https://www.goodreads.com/book/show/21432670-locke-key-vol-1', 'Joe Hill', 'https://www.goodreads.com/author/show/88506.Joe_Hill', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1394600130l/21432670._SX98_.jpg', 'Locke & Key tells of Keyhouse, an unlikely New England mansion, with fantastic doors that transform all who dare to walk through them. Home to a hate-filled and relentless creature that will not rest until it forces open the most terrible door of them all...', NULL),
(9, 'How It Feels to Float', 'https://www.goodreads.com/book/show/44007280-how-it-feels-to-float', 'Helena Fox', 'https://www.goodreads.com/author/show/18409901.Helena_Fox', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1550443011l/44007280._SX98_.jpg', 'Biz knows how to float. She has her posse, her mum and the twins. She has Grace. And she has her dad, who tells her about the little kid she was, and who shouldn\'t be here - because he died when she was seven - but is. So she doesn\'t tell anyone her dark thoughts. She knows how to float, right there on the surface - normal okay regular fine.\r\n\r\nBut when the tethers that hold Biz steady come undone - when her dad disappears along with all comfort - might it be easier, better, sweeter to float away?\r\n\r\nThis is a mesmerising, radiant debut. It\'s a story about love, grief, family and friendship, about intergenerational mental illness, and about how living with it is both a bridge and a chasm to the ones we\'ve lost. Helena Fox explores the hard, bewildering and beautiful places loss can take us, and honours those who hold us tightly when the current wants to tug us out to sea.', NULL),
(10, 'Permanent Record', 'https://www.goodreads.com/book/show/50777532-permanent-record', 'Edward Snowden', 'https://www.goodreads.com/author/show/7140597.Edward_Snowden', 'https://i.gr-assets.com/images/S/compressed.photo.goodreads.com/books/1570591586l/50777532._SX318_SX98_.jpg', 'Edward Snowden, the man who risked everything to expose the US government’s system of mass surveillance, reveals for the first time the story of his life, including how he helped to build that system and what motivated him to try to bring it down.\r\n\r\nIn 2013, twenty-nine-year-old Edward Snowden shocked the world when he broke with the American intelligence establishment and revealed that the United States government was secretly pursuing the means to collect every single phone call, text message, and email. The result would be an unprecedented system of mass surveillance with the ability to pry into the private lives of every person on earth. Six years later, Snowden reveals for the very first time how he helped to build this system and why he was moved to expose it.\r\n\r\nSpanning the bucolic Beltway suburbs of his childhood and the clandestine CIA and NSA postings of his adulthood, Permanent Record is the extraordinary account of a bright young man who grew up online—a man who became a spy, a whistleblower, and, in exile, the Internet’s conscience. Written with wit, grace, passion, and an unflinching candor, Permanent Record is a crucial memoir of our digital age and destined to be a classic.', NULL);
